import React from "react";

const Home = () => {
  return (
    <div className="p-6 text-center">
      <h1 className="text-4xl font-bold text-blue-600">Welcome to Our Website</h1>
      <p className="mt-4 text-lg text-gray-700">Explore our features and services.</p>
    </div>
  );
};

export default Home;
